import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap'
import { BoxArrowLeft } from 'react-bootstrap-icons';
const custom_style_logo = { fontWeight: "900", marginLeft: "50px" };
function NavbarComponent() {
    return (
        <div className="Navbar">
            <div className="flexBox_column">
                <div>
                    <p style={custom_style_logo}>Crack off Campus</p>
                    <p href="#referals">Referals</p>
                    <p href="#post" >Resume</p>
                    <p href="#post" >Post Job</p>
                    <p href="#post" >Careers</p>
                </div>
                <div>

                </div>

            </div>

            <div style={{ display: 'flex', marginTop: 'auto', marginBottom: 'auto' }}>
                <BoxArrowLeft style={{ marginRight: "7px" }} id="logo_account" title="goodbye" color="#000" size={23} />
                <p style={{ justifyContent: "center" }}>Logout</p>
            </div>

        </div >
    )
}

export default NavbarComponent;

